    private function createWorkingTypeMap($code, $workingType, $id)
    {
        $activityType = ActivityType::query()->where('code', $code)->first();
        if($activityType){
            try {
                WorkingTypeMap::query()->updateOrCreate(['id' => $id], [
                    'working_type_id' => $workingType,
                    'activity_type_id' => $activityType->id
                ]);
            }catch (\Exception $e){

            }
        }
    }
